import React from "react";
import PropTypes from "prop-types";

const PostImages = ({ images }) => {
  if (images.length === 1) {
    return (
      <>
        <div>
          <img src={images} />
        </div>
      </>
    );
  }
  return <div></div>;
};

PostImages.propTypes = {};

export default PostImages;
